import React from "react";
function Card(props) {
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.img} alt="image" />
      <p>{props.tel}</p>
    </div>
  );
}
const Contact = () => {
  return (
    <div>
      <>
        <Card
          name="Sundar pichai"
          img="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQIYCzMSvQHNB3qwcdDRFzs01p1nIJK3r04JuHsPMnjU6pKKWkV"
          tel="14165546"
        />
      </>
    </div>
  );
};

export default Contact;
